import React, { useState, useEffect } from "react";
import Textfield from "../components/common/textfield";
import Button from "../components/common/button";
function Update() {
  const [oldUserDatatState, setOldUserState] = useState(null);
  const [newName,setNewName]=useState(oldUserDatatState.name);
  const [newEmail,setNewEmail]=useState(null);  
  useEffect(() => {
    let oldUserData = JSON.parse(localStorage.getItem("editUserData"));
    setOldUserState(oldUserData);
    console.log(oldUserData);
  }, []);
 
  const editedUser = () => {
    console.log("/////////////////");
  };

  if (oldUserDatatState) {
    return (
      <div>
        <Textfield
          id={"name"}
          label={"Name"}
          type={"text"}
          value={newName}
          onChange={(e) => {
            setNewName(e.target.value);
          }}
        />{" "}
        <br />
        <Textfield
          id={"email"}
          label={"Email"}
          type={"text"}
          value={newEmail}
          onChange={(e) => {
            setNewEmail(e.target.value);
          }}
        />{" "}
        <br />
        <Button label={"Update"} onClick={editedUser} /> <br />
      </div>
    );
  } else {
    return <div>Loading......</div>;
  }
}
export default Update;
